import React from 'react'


const MakeRoom = ({onRoomChange,onEnter,onCreate,onNameChange}) =>{
    return(
        <div>
            <input placeholder="Enter name" onChange={onNameChange}></input><br></br>
            <input placeholder="Enter room code" onChange={onRoomChange}></input><br></br>
            <button onClick={onEnter} >JOIN</button><br></br>
            <button onClick={onCreate} >CREATE</button>
        </div>
    );
}

export default MakeRoom;
